import { logoutReducer } from './loginReducer'

const Logout = () => {
  const dispatch = useDispatch()
  return (
    <>
      <button
      type="submit"
      className="btn2 btn-light btn-lsm"
      onClick={() => dispatch(logoutReducer())}
      >
      logout
      </button>
    </>
  )
}
